import React, { useEffect, useState } from 'react';
import './RequestsList.css';
import SongDeleteButton from './SongDeleteButton';
import Axios from 'axios';

const RequestsList = (canDelete) => {

    const [requests, setRequests] = useState([]);

    useEffect(()=> {
        Axios.get('http://localhost:3001/songGet').then((response)=> {
            setRequests(response.data);
            console.log(requests);
        });
    }, []);

    return (
        <div className="RequestsList">
            {requests.map((item, i) =>
                <div className="RequestsEntry" key={i}> {item.SONG} by {item.ARTIST} {console.log(i)} {<SongDeleteButton song={item.SONG} artist={item.ARTIST} />}</div>
            )}
        </div>
    )
}

export default RequestsList;
